$('.menu .item').tab();
$('#country').dropdown('set selected', '<?php echo $country; ?>');
$('#selectTypes').dropdown({maxSelections: 5});
$('.ui.dropdown').dropdown();
$(".confirm").click(function(){return confirm($(this).data("confirm"))});
$('article').readmore();
$('.ui.checkbox').checkbox();
$('.ui.sidebar').sidebar('setting', 'transition', 'overlay').sidebar('attach events', '.toggle-sidebar', 'toggle');
$('.message .close').on('click', function() {
    $(this).closest('.message').transition('fade');
});

$('#toggleServerMenu').on('click', function() {
	$(".nav-menu").toggle();
});

$('#toggleSearch').on('click', function() {
	$(".insta-search").toggle();
});

$('#votifierToggle').on('change', function() {
	$(".votifier").toggleClass('visible');
});

$('#orderBy .item').on('click', function() {
	var value = $(this).data('value');
	Cookies.set('listOrder', value);
	location.reload();
});

$('.defaultLang .item').on('click', function() {
	var value = $(this).data('value');
	Cookies.set('defaultLang', value);
	location.reload();
});

$('.webDesign .item').on('click', function() {
	var value = $(this).data('value');
	Cookies.set('webDesign', value);
	location.reload();
});

$('#resetOrder').on('click', function() {
	Cookies.remove('listOrder');
	location.reload();
});

function insta_search(){
	var e = document.getElementById('search_cat');
	var query_input = e.options[e.selectedIndex].value;
	if (!query_input) {
		query_input = 1;
	} else {
		query_input = e.options[e.selectedIndex].value;
	}
	$('.ui.search').search({
	    apiSettings: {
	      url: 'servers-search/q={query}&cat='+query_input
	    },
	    fields: {
	      results : 'results',
	      title   : 'title',
	      description   : 'description',
	      url     : 'url'
	    },
	    minCharacters : 3
	});
}
function scaleCaptcha(e){var t=$(".captcha-form").width();if(304>=t-20){var n=(t-20)/304;$(".g-recaptcha").css({transform:"scale("+n+")"})}}
$(".copy-action").click(function() {
    var e = $(".copy-action").width();
    $(this).find(".copy-success").animate({
            width: e,
            "padding-right": 5,
            "padding-left": 5
        }, {
            duration: 200
        }), setTimeout(function() {
            $(".copy-success").animate({
                width: 0,
                "padding-right": 0,
                "padding-left": 0
            }, {
                duration: 200
            })
        }, 1e3);
        var t = new ClipboardJS(".copy-action");
        t.on("success", function(e) {
            e.clearSelection()
        }), t.on("error", function(e) {
            console.log(e)
        })
});
scaleCaptcha();
